■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>不足しがちな栄養補給に!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0343/9847an-01.jpg" width="600" height="600"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">【保存方法】<br>高温多湿や直射日光を避け、冷暗所に保存し、開封後はしっかりフタを閉め、なるべくお早めにお召し上がり下さい。<br><br>【お召し上がり方】<br>1.栄養補助食品として1日にティースプーン2～5杯を目安にお召し上がり下さい。<br>2.そのまま、又は水やミルク、ヨーグルトに混ぜてお召し上がり下さい。<br>3.栄養補助食品としてお料理などに混ぜても美味しくお召し上がりいただけます。<br><br>【製造(販売)者】<br>株式会社ファイン<br>大阪市東淀川区下新庄5丁目7番8号</font></td></tr></table><br><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">国内で製造されたもので、たんぱく質、食物繊維、7種類のビタミンB群、8種類のミネラル等、食事だけでは不足しがちな栄養素の補給に役立ちます。本品には、ビール酵母エキスが入っていますので、コクがあり料理の隠し味としてもご利用頂けます。また、そのままサプリメントとしてもご利用できます。ヨーグルトなどに入れて栄養バランスの良い美容ダイエット食のお手伝いにもなります。</font></td></tr></table></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF">    <td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td>    <td width="75%"><font color="#333333" size="-1">100g当たり/エネルギー：307kcal、たんぱく質：47.5g、脂質：2.6g、糖質：8.2g、食物繊維：30.6g、ナトリウム：230mg、ビタミンB1：11.8mg、ビタミンB2：3.0mg、ビタミンB6：2.7mg、ナイアシン：29.7mg、葉酸：1.6mg、パントテン酸：6.1mg、ビオチン：111μg、カリウム：1900mg、カルシウム：250mg、マグネシウム：260mg、リン：1800mg、鉄：5.4mg、亜鉛：6mg、銅：350μg、マンガン：930μg</font></td></tr><tr bgcolor="#FFFFFF">    <td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td>    <td width="75%"><font color="#333333" size="-1">乾燥ビール酵母、ビール酵母エキス</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">国内で製造されたもので、たんぱく質、食物繊維、7種類のビタミンB群、8種類のミネラル等、食事だけでは不足しがちな栄養素の補給に役立ちます。本品には、ビール酵母エキスが入っていますので、コクがあり料理の隠し味としてもご利用頂けます。また、そのままサプリメントとしてもご利用できます。ヨーグルトなどに入れて栄養バランスの良い美容ダイエット食のお手伝いにもなります。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">200g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：8×8×13cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：315g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">特許製品(特許第3499219号)、粉末・顆粒</font><br><font color="#333333" size="-1">商品区分：健康食品</font><br> <font color="#333333" size="-1">賞味期間：製造日より24ヶ月</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--スペックここまで--><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
