■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>ストレスフリーで食事はしっかり!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0373/8295aq-01.jpg" width="500" height="792"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">【お召し上がり方】<br>・栄養補助食品として1日5粒を目安に、水またはぬるま湯でお召し上がり下さい。<br><br>【保存方法】<br>高温多湿や直射日光を避けて涼しいところに保存してください。<br><br>【注意事項】<br>・原材料にアレルギーのある方は摂取をお控えください。<br>・本品は自然由来の素材を使用しておりますので、商品により色や味に違いが生じる場合がありますが、品質上問題ありません。<br>・妊娠・授乳中の方、治療中の方はお召し上がりの前に医師にご相談ください。<br><br>【製造(販売)者】<br>株式会社ファイン<br>大阪市東淀川区下新庄5丁目7番8号</font></td></tr></table><br><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">「食べたい」を我慢しない、ストレスフリーなサプリメント。桑樹皮・ギムネマ・キトサン配合。小粒タイプなので飲みやすく、取り出し口が密封式ジッパー袋になっていて便利です!</font></td></tr></table></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF">    <td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td>    <td width="75%"><font color="#333333" size="-1">栄養成分/5粒(1gあたり):エネルギー3.5kcal、たんぱく質0.16g、脂質0g、炭水化物0.66g、ナトリウム1.7mg、規格成分/5粒(1gあたり):桑葉粉末250mg、桑茎粉末250mg、キトサン100mg、クロム30μg</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><!--アレルギー表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666">    <tr>        <td align="center" bgcolor="#FFFFCC" colspan="7"><font color="#333333" size="-1">アレルギー表示（原材料の一部に以下を含んでいます）</font></td>    </tr>    <tr>        <td width="14%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">卵</font></td>        <td width="14%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">乳</font></td>        <td width="14%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">小麦</font></td>        <td width="14%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">そば</font></td>        <td width="14%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">落花生</font></td>        <td width="14%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">えび</font></td>        <td width="14%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">かに</font></td></tr>    <tr bgcolor="#FFFFFF">        <td width="14%" align="center"><font color="#333333" size="-1"></font></td>        <td width="14%" align="center"><font color="#333333" size="-1"></font></td>        <td width="14%" align="center"><font color="#333333" size="-1"></font></td>        <td width="14%" align="center"><font color="#333333" size="-1"></font></td>        <td width="14%" align="center"><font color="#333333" size="-1"></font></td>        <td width="14%" align="center"><font color="#333333" size="-1">●</font></td>        <td width="14%" align="center"><font color="#333333" size="-1">●</font></td>    </tr></table><br><!--アレルギー表ここまで--><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">「食べたい」を我慢しない、ストレスフリーなサプリメント。桑樹皮・ギムネマ・キトサン配合。小粒タイプなので飲みやすく、取り出し口が密封式ジッパー袋になっていて便利です!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">56.7g(630mg×90粒)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#33333