■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>油っこいものが好きな方や、好きなものを気にせず食べたい方に!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5347/1030113-01.jpg" width="500" height="500"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#999999"><tr><td bgcolor="#FFFFCC"><table width="100%" border="0" cellpadding="3" cellspacing="0"><tr><th><font color="#FF0000">------&nbsp;ココがポイント！&nbsp;------</font></th></tr><tr><td><strong><font size="3" color="#FF9900">●クロロゲン酸類、発酵黒ウーロン茶エキス、キトサン、竹炭が脂質をサポート!</font></strong></td></tr><tr><td><strong><font size="3" color="#FF9900">●飲みやすい小粒タイプ、チャック付きアルミ袋で、持ち運び便利!</font></strong></td></tr></table></td></tr></table><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【お召し上がり方】<br>栄養機能食品として1日5粒を目安に、水またはぬるま湯でお召し上がりください。 <br><br>【製造者】<br>株式会社ファイン<br>大阪市東淀川区下新庄5丁目7番8号</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="513" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5347/1030113-02.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">しっかり食事を摂る健康的なダイエットをサポートするサプリメントです。 </font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font col