■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>大注目のガルシニアにサラシア・シトラスまで配合。</strong></font></td></tr></table><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="center"><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0144/9176z-01.jpg" width="600px" height="902px" ><br><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#999999"><tr><td bgcolor="#FFFFCC"><table width="100%" border="0" cellpadding="3" cellspacing="0"><tr><th><font color="#FF0000">------ ココがポイント！ ------</font></th></tr><tr><td><strong><font size="3" color="#FF9900">●甘いものが好きな方に</font></strong></td></tr></table></td></tr></table><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">食品として、1日に3粒程度を目安に水などでお召し上がり下さい。万一、体質に合わない場合はご利用を中止して下さい。天然由来の成分を主として使用しているため、多少色のバラツキが生じる場合がございますが、品質には全く問題ありません。<br><br>【原材料】<br>ガルシニアエキス末、サラシア末、寒天、麦芽糖、シトラスエキス末、サラシアエキス末、貝殻焼成Ca、ショ糖エステル、結晶セルロース、ステアリン酸Ca、微粒二酸化ケイ素<br><br>【栄養成分表示】(3粒900mgあたり)<br>エネルギー2.91kcal<br>たんぱく質0.015g<br>脂質0.07g<br>炭水化物0.55g<br>ナトリウム5.16mg<br>ガルシニアエキス末300mg<br>サラシア末180mg<br>サラシアエキス末15mg<br>シトラスエキス末30mg</font></td></tr></table><br><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">ガルシニアとは、東南アジアから南アジアに自生するガルシニア・カンボジアという柑橘類に由来するサプリメントです。主に、カレーの香辛料や魚の保存などに利用されていました。近年、果実に含まれるヒドロキシクエン酸(HCA)という成分が食欲を調節すると注目されています。本品はこの大注目のガルシニアに加え、サラシアやシトラスエキスを配合しています。</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ガルシニアとは、東南アジアから南アジアに自生するガルシニア・カンボジアという柑橘類に由来するサプリメントです。主に、カレーの香辛料や魚の保存などに利用されていました。近年、果実に含まれるヒドロキシクエン酸(HCA)という成分が食欲を調節すると注目されています。本品はこの大注目のガルシニアに加え、サラシアやシトラスエキスを配合しています。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">162g(300mg×540粒)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：12×3.5×21cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">170g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">区分：健康食品<br>名称：ガルシニアエキス、サラシア、シトラスエキス含有食品<br>販売者：補完医療製薬株式会社　大阪市中央区谷町9-2-27-303Ａ<br>保存方法：直射日光、高温多湿を避けて保存して下さい。<br>賞味期限：製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
